import React, { useEffect, useState } from "react";
import axios from "axios";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar.jsx";
import Search from "./components/Search.jsx";
import Add from "./components/Add.jsx";
import Flight from "./components/Flight.jsx";
import Home from "./components/Home.jsx";
import Hotel from "./components/Hotel.jsx";
import Reservation from "./components/Reservation.jsx";
import SearchRes from "./components/SearchRes.jsx";

const App = () => {
  const [flights, setFlights] = useState([]);
  const [reservation, setReservation] = useState([]);
  const [query, setQuery] = useState({});

  useEffect(() => {
    axios
      .get("http://localhost:3000/api/flight/")
      .then((res) => {
        setFlights(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [flights]);

  useEffect(() => {
    axios
      .get("http://localhost:3000/api/flight/reservation")
      .then((res) => {
        setReservation(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, [reservation]);
  return (
    <>
      
      
      <Router>
        <Navbar />
        <Search />
        <Routes>
          <Route path="/home" element={<Home />} />
          <Route path="/hotel" element={<Hotel />} />
          <Route path="/reserv" element={<Reservation reservation={reservation} />} />
          <Route path="/flights" element={<Flight flights={flights} />} />
          <Route path="/flight/add" element={<Add />} />
          <Route path="/search/destination" element={<SearchRes />}/>
        </Routes>
      </Router>
    </>
  );
};

export default App;
